import{_ as o}from"./plugin-vue_export-helper-c27b6911.js";import{r as t,o as r,c as i,d as n,w as c,a as e,e as d,b as s}from"./app-03a8eccb.js";const h="/assets/image-27d813de.png",l={},p=e("figure",null,[e("img",{src:h,alt:"下雪了",tabindex:"0",loading:"lazy"}),e("figcaption",null,"下雪了")],-1),_=d('<h2 id="_1-下雪啦" tabindex="-1"><a class="header-anchor" href="#_1-下雪啦" aria-hidden="true">#</a> 1. 下雪啦!!!!</h2><p>西安上周还在穿半袖，这周就突然降温，然后在双十一今天，开始下大雪了！！ 甚至还有冬雷！在我印象里面好像没怎么见过冬天打雷的天气。有民间谚语说</p><blockquote><p>立冬雷发声，秋粜贵。冬雷震动，万物不成，虫不藏，常兵起。冬至日雷，天下大兵，盗贼横行。</p></blockquote><p>在如今多事之秋的日子里，感觉冬雷好像蛮应景的。期望明年能够一帆风顺。</p><p>想开车去秦岭看雪，想去山里滑雪，想去泡温泉。</p><h2 id="_2-双十一购物清单" tabindex="-1"><a class="header-anchor" href="#_2-双十一购物清单" aria-hidden="true">#</a> 2. 双十一购物清单</h2><p>今年双十一感觉很凄凉，之前几年就算没啥要买的东西，我也会在11.10晚上守着淘宝，掐点凑点东西，感觉不买就有点亏的那种感觉。<br> 今年给自己换了不少电子设备。</p><ol><li>iPhone11 64G -&gt; iPhone11 128G,给老婆换了一个iPhone15，然后我用她的128G的iPhone， 大容量用起来真舒服，以后再也不抠抠搜搜的买64了。</li><li>MacBook Pro 2017 -&gt; MacBook M2 pro. 老Mac现在用的像一头老牛，虽然还能继续干活，但是用起来有点力不从心的感觉。咬咬牙索性是换了。还是年轻的用着爽啊。。。。</li><li>给猫买屯的一大堆货，猫砂、猫粮、驱虫药，零食。。。一大堆东西。</li></ol><p>哦今天还买了微信读书会员年卡，希望能够物尽其用。</p><h2 id="_3-ai工具" tabindex="-1"><a class="header-anchor" href="#_3-ai工具" aria-hidden="true">#</a> 3. AI工具</h2><p>自从今年年初chatGPT爆火以后，AI工具就层出不穷。前两天OpenAI的开发者大会更是令人耳目一新，而且他们的 DALL·E 3 ，我感觉已经追上midjourney的生成效果了，还不用去写那些陌生的prompt，真的是太酷了。我已经在期待OpenAI的仿生人了。</p><h2 id="_4-糟心事" tabindex="-1"><a class="header-anchor" href="#_4-糟心事" aria-hidden="true">#</a> 4. 糟心事</h2><p>Siri是一只猫，他一到10月、11月就开始在家里乱尿，前两天发现一晚上他在床上尿了2处，气炸了....猫尿真的太臭了，这个味道又很难洗掉...</p>',13);function u(f,m){const a=t("center");return r(),i("div",null,[p,n(a,{style:{"font-size":"14px",color:"#C0C0C0","text-decoration":"underline"}},{default:c(()=>[s("西安下大雪")]),_:1}),_])}const g=o(l,[["render",u],["__file","2023-11-11.html.vue"]]);export{g as default};
